import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { motion, AnimatePresence } from 'framer-motion';
import { FaUserMd, FaCut, FaHandHoldingMedical, FaHeartbeat, FaBrain, FaBug, FaRunning, FaWater, FaExclamationTriangle, FaGraduationCap, FaHammer, FaFirstAid, FaSoap, FaShoePrints, FaHandsHelping, FaChevronDown, FaChevronUp, FaClock, FaCheckCircle } from 'react-icons/fa';

const Services = () => {
  const services = [
    {
      icon: <FaUserMd className="w-8 h-8" />,
      title: "Diabetic Foot Assessment",
      description: "Comprehensive evaluation of foot health for diabetic patients, including circulation and sensation testing to prevent complications.",
      duration: "45-60 minutes"
    },
    {
      icon: <FaCut className="w-8 h-8" />,
      title: "Toenail Cutting & Trimming",
      description: "Professional nail care service including proper cutting, shaping, and maintenance for healthy nail growth.",
      duration: "30 minutes"
    },
    {
      icon: <FaHandHoldingMedical className="w-8 h-8" />,
      title: "Corn/Callus Removal & Debridement",
      description: "Safe removal of corns and calluses using professional techniques to relieve pain and prevent recurrence.",
      duration: "30-45 minutes"
    },
    {
      icon: <FaHeartbeat className="w-8 h-8" />,
      title: "Peripheral Circulation & Sensation Assessment",
      description: "Evaluation of blood flow and nerve function in feet to detect early signs of circulation problems.",
      duration: "30 minutes"
    },
    {
      icon: <FaBrain className="w-8 h-8" />,
      title: "Peripheral Neuropathy Assessment",
      description: "Specialized testing to detect nerve damage in feet, particularly important for diabetic patients.",
      duration: "30-45 minutes"
    },
    {
      icon: <FaBug className="w-8 h-8" />,
      title: "Fungal Nail Care",
      description: "Treatment and management of fungal nail infections with professional care and prevention strategies.",
      duration: "30-45 minutes"
    },
    {
      icon: <FaRunning className="w-8 h-8" />,
      title: "Athlete's Foot Treatment",
      description: "Effective treatment for athlete's foot fungal infections with education on prevention and care.",
      duration: "30 minutes"
    },
    {
      icon: <FaWater className="w-8 h-8" />,
      title: "Dry Skin & Fissure Treatment",
      description: "Treatment for dry, cracked skin and heel fissures to restore skin health and prevent infection.",
      duration: "30-45 minutes"
    },
    {
      icon: <FaExclamationTriangle className="w-8 h-8" />,
      title: "Ingrown Toenail Care",
      description: "Professional treatment for ingrown toenails including pain relief and prevention techniques.",
      duration: "30-45 minutes"
    },
    {
      icon: <FaGraduationCap className="w-8 h-8" />,
      title: "Patient Education",
      description: "Comprehensive education on foot care, hygiene, and prevention strategies for optimal foot health.",
      duration: "15-30 minutes"
    },
    {
      icon: <FaHammer className="w-8 h-8" />,
      title: "Hard Nail Cutting & Trimming",
      description: "Specialized care for thick, hard nails that are difficult to manage at home.",
      duration: "30-45 minutes"
    },
    {
      icon: <FaFirstAid className="w-8 h-8" />,
      title: "Wound Assessment & Referral",
      description: "Professional assessment of foot wounds with appropriate referrals when specialized care is needed.",
      duration: "30 minutes"
    },
    {
      icon: <FaSoap className="w-8 h-8" />,
      title: "Foot Hygiene & Education",
      description: "Guidance on proper foot hygiene practices and daily care routines for healthy feet.",
      duration: "20-30 minutes"
    },
    {
      icon: <FaShoePrints className="w-8 h-8" />,
      title: "Footwear Recommendations",
      description: "Professional advice on proper footwear selection for your specific foot type and conditions.",
      duration: "20-30 minutes"
    },
    {
      icon: <FaHandsHelping className="w-8 h-8" />,
      title: "Moisturizer + Foot Massage",
      description: "Relaxing foot massage with therapeutic moisturizing treatment to improve circulation and skin health.",
      duration: "30-45 minutes"
    }
  ];

  return (
    <div className="min-h-screen bg-white">
      {/* Hero Section */}
      <section className="bg-gradient-to-br from-primary to-secondary text-white py-16">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 text-center">
          <motion.h1
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="text-4xl md:text-5xl font-bold mb-6"
          >
            Our Services
          </motion.h1>
          <motion.p
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            className="text-xl max-w-3xl mx-auto"
          >
            Comprehensive foot care services designed to keep your feet healthy, comfortable, and pain-free
          </motion.p>
        </div>
      </section>

      {/* Services Grid */}
      <section className="py-16">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {services.map((service, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="bg-white rounded-lg shadow-lg p-6 hover:shadow-xl transition-shadow border border-gray-100"
              >
                <div className="text-primary mb-4">
                  {service.icon}
                </div>
                <h3 className="text-xl font-semibold text-text mb-3">
                  {service.title}
                </h3>
                <p className="text-gray-600 mb-4">
                  {service.description}
                </p>
                <div className="flex justify-between items-center">
                  <span className="text-sm text-gray-500">
                    Duration: {service.duration}
                  </span>
                  <Link
                    to="/book-appointment"
                    className="bg-primary text-white px-4 py-2 rounded-full text-sm font-medium hover:bg-secondary transition-colors"
                  >
                    Book Now
                  </Link>
                </div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-16 bg-accent">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 text-center">
          <h2 className="text-3xl font-bold text-text mb-4">
            Ready to Schedule Your Appointment?
          </h2>
          <p className="text-lg text-gray-600 mb-8 max-w-2xl mx-auto">
            Our experienced team is here to provide you with the best foot care services in Calgary.
          </p>
          <div className="flex flex-col sm:flex-row gap-4 justify-center">
            <Link
              to="/book-appointment"
              className="bg-primary text-white px-8 py-3 rounded-full font-semibold hover:bg-secondary transition-colors"
            >
              Book Appointment
            </Link>
            <a
              href="tel:403-903-4293"
              className="border-2 border-primary text-primary px-8 py-3 rounded-full font-semibold hover:bg-primary hover:text-white transition-colors"
            >
              Call 403-903-4293
            </a>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Services;
